long long getCurrentTimeInMilliseconds2()
{
    struct timeval currentTime;
    gettimeofday(&currentTime, NULL);
    return currentTime.tv_sec * 1000LL + currentTime.tv_usec / 1000LL;
}

void CheckPosition(char *fen, int depth, U64 nodesExpected)
{
    BoardState boardState[1];
    InitAll(boardState);
    SetBoard(fen, boardState);
    long long t0 = getCurrentTimeInMilliseconds2();
    U64 nodes = Perft(boardState->position, depth, 0);
    long long t1 = getCurrentTimeInMilliseconds2();
    printf("number of nodes %lld\ttime in ms %lld\n", nodes, (t1 - t0));
    assert(nodes == nodesExpected);
}

